        while ((m = re.exec(s))) {
            const x = parseFloat(m[1]);
            const y = parseFloat(m[2]);
            const z = m[3] ? parseFloat(m[3]) : 0;
            flatCoordinates.push(x, y, z);
            s = s.substr(m[0].length);
        }
        if (s !== '') {
            return undefined;
        }
        return flatCoordinates;
